
import React, { Component } from 'react';
import { Text, StatusBar, Slider, ScrollView, Platform, View, FlatList, RefreshControl, Image, TouchableOpacity, BackHandler, Modal } from 'react-native';
import { Container, Body, Content, Header, Right, Left, Button, List, ListItem } from 'native-base';
import styles from '../tabs/ContainTabStyle';
import Ionicons from "react-native-vector-icons/Ionicons";
import CategoryItem from '../components/CategoryItem';
import store from '../store/store.js';
import { observer } from 'mobx-react';
import {
    WaveIndicator,
    UIActivityIndicator
} from 'react-native-indicators';
import BottomCart from '../components/Cart';

const icons = [
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,"
]

@observer
export default class Category extends Component {
    state = {
        refreshing: false,
        dataSource: [],
        scrolled: false,
        loading: false,
        offset: 0,
        end: false,
        modalVisible: false,
        data: {},
        showChild: {},
        class: {},
        slider: 200000,
        settedPrice: 0,
        selectedCat: -1,
        selectedName: "",
        headerText: "",
        filterLoaded: false,
        loadingMain: true
    }

    storage = 0;

    constructor(props) {
        super(props);

        BackHandler.addEventListener('hardwareBackPress', this.handleBackPress);

        this.makeItems = this.makeItems.bind(this);
        this.refresh = this.refresh.bind(this);
        this.onScroll = this.onScroll.bind(this);
        this.footer = this.footer.bind(this);
        this.handleBackPress = this.handleBackPress.bind(this);
        this.getData = this.getData.bind(this);
        this.goBackTo = this.goBackTo.bind(this);
        this._empty = this._empty.bind(this);
    }

    componentDidMount() {
        const { navigation } = this.props;
        const name = navigation.getParam('name', 'Category');
        this.setState({ headerText: name });
        this.setState({ selectedName: name });

        const id = this.props.navigation.getParam('id', -1);
        this.setState({ id: id });
        this.setState({ loadingMain: true });
        this.getData(id, []);
        this.getCategory();
    }


    componentWillUnmount() {
        BackHandler.removeEventListener('hardwareBackPress', this.handleBackPress);
    }

    goBackTo() {
        BackHandler.addEventListener('hardwareBackPress', this.handleBackPress);
    }

    handleBackPress = () => {
        //this.props.navigation.goBack();
        this.props.navigation.state.params.onGoBack();
    }

    getCategory = () => {
        return fetch(store.url + '/app_api/mobile/mobile.php?main_cat_all=1' + '&deviceId=' + store.deviceId)
            .then((response) => response.json())
            .then((responseJson) => {
                var json = responseJson;
                this.setState({
                    data: json,
                });
                this.setState({
                    filterLoaded: true
                });

            })
            .catch((error) => {
                console.error(error);
            });
    }

    async getData(id, dataSource) {
        if (this.storage != 0) {
            var pro = this.storage.slice(this.state.offset, (this.state.offset + 10));
            this.setState({ offset: this.state.offset + Object.keys(pro).length });
            this.setState({ dataSource: dataSource });
            var array = [];
            if (Object.keys(pro).length < 10) {
                this.setState({ end: true });
            }

            if (Object.keys(pro).length > 0) {
                for (let i in pro) {
                    if (i % 2 == 0) {
                        array[0] = pro[i];
                        if (Object.keys(pro).length == (parseInt(i) + 1)) {
                            await this.setState({
                                dataSource: [...this.state.dataSource, array]
                            });
                            array = [];
                        }
                    } else {
                        array[1] = pro[i];
                        await this.setState({
                            dataSource: [...this.state.dataSource, array]
                        });
                        array = [];
                    }

                }
            } else {
                this.setState({ end: true });
            }
            this.setState({ refreshing: false });
            this.setState({ id: id });
            this.setState({ selectedCat: id });
            if (this.state.loading)
                this.setState({ loading: true });
        } else {
            var price = "";
            if (this.state.settedPrice > 0) {
                price = "&price=" + this.state.settedPrice;
            }

            var lan = 0;
            if (store.langId == 1)
                lan = 2;
            else if (store.langId == 2)
                lan = 1;

            return fetch(store.url + '/app_api/mobile/mobile.php?id=' + id + '&main_page=1&langId=' + lan + '&price=' + this.state.slider + '&deviceId=' + store.deviceId)
                .then((response) => response.json())
                .then(async (responseJson) => {
                    var products = responseJson.categories[0].products;
                    this.storage = products;
                    var pro = products.slice(this.state.offset, (this.state.offset + 10));
                    this.setState({ offset: this.state.offset + Object.keys(pro).length });
                    this.setState({ dataSource: dataSource });
                    var array = [];
                    if (Object.keys(pro).length < 10) {
                        this.setState({ end: true });
                    }

                    if (Object.keys(pro).length > 0) {
                        for (let i in pro) {
                            if (i % 2 == 0) {
                                array[0] = pro[i];
                                if (Object.keys(pro).length == (parseInt(i) + 1)) {
                                    await this.setState({
                                        dataSource: [...this.state.dataSource, array]
                                    });
                                    array = [];
                                }
                            } else {
                                array[1] = pro[i];
                                await this.setState({
                                    dataSource: [...this.state.dataSource, array]
                                });
                                array = [];
                            }

                        }
                    } else {
                        this.setState({ end: true });
                    }
                    this.setState({ refreshing: false });
                    this.setState({ id: id });
                    this.setState({ selectedCat: id });
                    if (this.state.loading)
                        this.setState({ loading: true });
                    this.setState({ loadingMain: false });
                })
                .catch((error) => {

                });
        }
    }

    setPrice(val) {
        this.setState({ slider: val });
    }

    onScroll() {
        this.setState({
            scrolled: !this.state.scrolled
        });
    }

    refresh() {
        this.setState({ refreshing: true });
        this.setState({ dataSource: [] });
        this.setState({ offset: 0 });
        const id = this.props.navigation.getParam('id', -1);
        this.getData(id, this.state.dataSource);
    }

    makeItems({ item }) {
        var items = [];
        for (let i in item) {
            let name = [item[i].name_4, item[i].name_4];
            var imageUrl = item[i].image + "-home_default/" + item[i].link_rewrite + ".jpg";
            items[i] = (
                <TouchableOpacity key={item[i].id} activeOpacity={1} onPress={() => {
                    this.props.navigation.navigate("ProductDetail", {
                        id: item[i].id,
                        count: store.count[item[i].id] > 0 ? store.count[item[i].id] : 0,
                        onGoBack: this.onScroll,
                        onGoBackTo: this.goBackTo
                    });
                }}>
                    <CategoryItem
                        id={item[i].id}
                        image_url={imageUrl}
                        price={item[i].price}
                        stock_available_quantity={item[i].stock_available_quantity}
                        count={store.count[item[i].id] > 0 ? store.count[item[i].id] : 0}
                        name={name[store.langId - 1]}
                        liked={store.liked[item[i].id] ? true : false}
                        sale={item[i].quantity_discount}
                        newProduct={item[i].new > 0 ? true : false}
                        star={item[i].star}
                        onChange={this.onScroll}
                    />
                </TouchableOpacity>);
        }
        return (<View style={styles.categoryList}>
            {
                items
            }
        </View>);
    }

    footer() {
        if (this.state.loading && !this.state.end) {
            return (<View style={{ width: '100%', height: 60, justifyContent: 'center' }}>
                <View style={{ height: 40, marginTop: 10 }}>
                    <UIActivityIndicator color="#ffcc00" size={24} />
                </View>
            </View>)
        } else {
            return (<View style={{ width: 0, height: 0 }}></View>);
        }
    }

    _empty() {
        return(
        <View style={styles.emptyBox}>
            <Text style={styles.emptyHeaderText}>{store.lang.noproduct}</Text>
        </View>)
    }

    selectCat = (id, name) => {
        if (this.state.data[id] != null) {
            const showChild = this.state.showChild;
            showChild[id] = !showChild[id];
            this.setState({ showChild: showChild });
        } else {
            let class1 = this.state.class;
            for (let m in class1) {
                class1[m] = false;
            }
            class1[id] = true;
            this.setState({ class: class1 });
            this.setState({ selectedCat: id });
            this.setState({ selectedName: name });
        }
    }


    _render() {
        const items = [];
        var data = this.state.data[2];
        var m = 0;
        for (let i in data) {
            const name = [data[i].name_4, data[i].name_4];
            const id = data[i].id;
            items[m] = (
                <ListItem style={styles.listItem2} key={m} onPress={() => this.selectCat(id, name[store.langId - 1])}>
                    <Image source={{ uri: icons[i] }} style={{
                        height: 20,
                        width: 20
                    }} />
                    <Text style={styles.listItemText3}>{name[store.langId - 1]}</Text>
                    {
                        this.state.class[id] && (<Ionicons name="ios-checkmark" size={24} color="green" style={{ marginLeft: 'auto' }} />)
                    }
                </ListItem>
            );
            m++;
            var data2 = this.state.data[data[i].id];
            for (let j in data2) {
                const name2 = [data2[j].name_4, data2[j].name_4];
                const id2 = data2[j].id;
                items[m] = (this.state.showChild[id] && <ListItem icon key={m} onPress={() => this.selectCat(id2, name2[store.langId - 1])}>
                    <Left style={{
                        width: '100%',
                        justifyContent: 'flex-start',
                        paddingLeft: 40
                    }}>
                        <Text style={styles.listItemText4}>{name2[store.langId - 1]}</Text>
                        {
                            this.state.class[id2] && (<Ionicons name="ios-checkmark" size={24} color="green" style={{ marginLeft: 'auto' }} />)
                        }
                    </Left>
                </ListItem>
                );
                m++;
                let data3 = this.state.data[id2]
                for (let k in data3) {
                    const name3 = [data3[k].name_4, data3[k].name_4];
                    const id3 = data3[k].id;
                    items[m] = (this.state.showChild[id] && this.state.showChild[id2] && <ListItem icon key={m} onPress={() => this.selectCat(id3, name3[store.langId - 1])}>
                        <Left style={{
                            width: '100%',
                            justifyContent: 'flex-start',
                            paddingLeft: 60
                        }}>
                            <Text style={styles.listItemText4}>{name3[store.langId - 1]}</Text>
                            {
                                this.state.class[id3] && (<Ionicons name="ios-checkmark" size={24} color="green" style={{ marginLeft: 'auto' }} />)
                            }
                        </Left>
                    </ListItem>
                    );
                    m++;
                    var data4 = this.state.data[id3];
                    for (let l in data4) {
                        const name4 = [data4[l].name_4, data4[l].name_4];
                        const id4 = data4[l].id;
                        items[m] = (this.state.showChild[id] && this.state.showChild[id2] && this.state.showChild[id3] && <ListItem icon key={m} onPress={() => this.selectCat(id4, name4[store.langId])}>
                            <Left style={{
                                width: '100%',
                                justifyContent: 'flex-start',
                                paddingLeft: 80
                            }}>
                                <Text style={styles.listItemText4}>{name4[store.langId - 1]}</Text>
                                {
                                    this.state.class[id4] && (<Ionicons name="ios-checkmark" size={24} color="green" style={{ marginLeft: 'auto' }} />)
                                }
                            </Left>
                        </ListItem>
                        );
                        m++;
                    }
                }
            }
        }
        return items;
    }

    changeToString = (val) => {
        var str = "";
        if (Math.floor(val / 1000) > 0) {
            var v = val / 1000;
            var dec1 = val - Math.floor(v) * 1000;
            if (dec1 > 0) {
                if (dec1 < 10)
                    dec1 = "00" + dec1;
                else if (dec1 < 100)
                    dec1 = "0" + dec1;
                str = str + dec1;
            }
            else
                str = str + "000";
            var dec2 = Math.floor(v / 1000);
            if (dec2 > 0) {
                var dec3 = Math.floor(v) - dec2 * 1000;
                if (dec3 < 10)
                    dec3 = "00" + dec3;
                else if (dec3 < 100)
                    dec3 = "0" + dec3;
                if (dec3 > 0)
                    str = dec3 + " " + str;
                else
                    str = "000 " + str;
                str = dec2 + " " + str;
            } else {
                str = Math.floor(v) + " " + str;
            }
        } else {
            str = val;
        }
        return str;
    }

    _keyExtractor = (item, index) => "c_" + item[0].id;

    render() {
        StatusBar.setBarStyle('light-content', true);
        if (Platform.OS === 'android') {
            StatusBar.setBackgroundColor('#ffbb00', true);
            StatusBar.setTranslucent(true);
        }

        if (Object.keys(this.state.dataSource).length === 0 && this.state.loadingMain) {
            return (<Container style={styles.container}>
                <Header style={styles.searchBarContainer}>
                    <Left style={styles.leftAppBar}>
                        <Button transparent onPress={() => {
                            this.props.navigation.goBack();
                            this.props.navigation.state.params.onGoBack();
                        }}>
                            <Ionicons name="ios-arrow-back" size={24} color="#000" />
                        </Button>
                    </Left>
                    <Body style={styles.bodyAppBar}>
                        <Text style={styles.headerTextOther}>{this.state.headerText}</Text>
                    </Body>
                    <Right style={styles.rightAppBar}>
                        <Button transparent onPress={() => {
                            this.setState({ modalVisible: true });
                        }}>
                            <Ionicons name="ios-funnel" size={24} color="#000" />
                        </Button>
                    </Right>
                </Header>
                <Content>
                    <View style={styles.emptyBox}>
                        <View style={styles.roundedBox}>
                            <Image source={require('../../assets/img/logo.jpg')} style={{ width: '100%', height: '100%' }} />
                        </View>
                        <View style={styles.activityIndicator}>
                            <WaveIndicator color="#ffcc00" />
                        </View>
                    </View>
                </Content>
            </Container>);
        } else {
            return (
                <Container style={styles.container}>
                    <Header style={styles.searchBarContainer}>
                        <Left style={styles.leftAppBar}>
                            <Button transparent onPress={() => {
                                this.props.navigation.goBack();
                                this.props.navigation.state.params.onGoBack();
                            }}>
                                <Ionicons name="ios-arrow-back" size={24} color="#000" />
                            </Button>
                        </Left>
                        <Body style={styles.bodyAppBar}>
                            <Text style={styles.headerTextOther}>{this.state.headerText}</Text>
                        </Body>
                        <Right style={styles.rightAppBar}>
                            <Button transparent onPress={() => {
                                this.setState({ modalVisible: true });
                            }}>
                                <Ionicons name="ios-funnel" size={24} color="#000" />
                            </Button>
                        </Right>
                    </Header>
                        <View style={styles.bodyWithoutFooter}>
                            <FlatList
                                extraData={this.state}
                                showsVerticalScrollIndicator={false}
                                data={this.state.dataSource}
                                keyExtractor={this._keyExtractor}
                                renderItem={this.makeItems}
                                onScroll={this.onScroll}
                                refreshControl={
                                    <RefreshControl
                                        refreshing={this.state.refreshing}
                                        onRefresh={this.refresh.bind(this)}
                                    />
                                }
                                initialNumToRender={3}
                                ListEmptyComponent={this._empty}
                                ListFooterComponent={this.footer}
                                onEndReached={() => {
                                    this.setState({ loading: true });
                                    this.getData(this.state.id, this.state.dataSource);
                                }}
                                removeClippedSubviews
                                disableVirtualization />
                        </View>
                        <BottomCart go={() => this.props.navigation.navigate("ContainTabCart", {
                                onGoBackTo: this.goBackTo
                            })} />
                        <Modal
                            animationType="fade"
                            transparent={true}
                            visible={this.state.modalVisible}
                            onRequestClose={() => { this.setState({ modalVisible: false }) }}>
                            <View style={styles.modal}>
                                <ScrollView style={styles.filterModal} showsVerticalScrollIndicator={false} showsHorizontalScrollIndicator={false}>
                                    <View style={{ flexDirection: 'row', width: '100%' }}>
                                        <TouchableOpacity style={{ marginLeft: 10, marginRight: 10, width: 40 }} onPress={() => {
                                            this.setState({ modalVisible: false });
                                        }}>
                                            <Text style={styles.close}>x</Text>
                                        </TouchableOpacity>
                                        <TouchableOpacity style={{ width: 60, marginLeft: 'auto' }} onPress={async () => {
                                            await this.setState({ settedPrice: this.state.slider });
                                            this.setState({ dataSource: [] });
                                            this.setState({ end: false });
                                            await this.setState({ offset: 0 });
                                            this.setState({ headerText: this.state.selectedName });
                                            this.setState({ id: this.state.selectedCat });
                                            this.storage = 0;
                                            this.getData(this.state.selectedCat, []);
                                            this.setState({ modalVisible: false });
                                        }}>
                                            <Text style={styles.apply}>{store.lang.search}</Text>
                                        </TouchableOpacity>
                                    </View>
                                    <View style={{ flexDirection: 'column', paddingLeft: 20, paddingRight: 20, paddingTop: 10, paddingBottom: 10, borderBottomWidth: 1, borderColor: 'rgba(240, 240, 240, 0.5)' }}>
                                        <View style={{ flexDirection: 'row' }}>
                                            <Text style={styles.priceText}>{store.lang.price}
                                            </Text>
                                            <Text style={{ marginLeft: 'auto', marginRight: 5, fontSize: 10, width: '30%', textAlign: 'right' }}>{this.changeToString(this.state.slider)}</Text>
                                        </View>
                                        <Slider
                                            style={styles.slider}
                                            step={1000}
                                            minimumValue={1000}
                                            maximumValue={200000}
                                            value={this.state.slider}
                                            onSlidingComplete={(val) => this.setPrice(val)} />
                                        <View style={{ flexDirection: 'row' }}>
                                            <Text style={styles.priceText1}>{store.lang.minPrice}</Text>
                                            <Text style={styles.priceText2}>{store.lang.maxPrice}</Text>
                                        </View>
                                    </View>
                                    {
                                        this.state.filterLoaded && (<List>
                                            {
                                                this._render()
                                            }
                                        </List>)
                                    }
                                    {
                                        !this.state.filterLoaded && (<View style={{ justifyContent: 'center', marginTop: 60, marginBottom: 'auto' }}>
                                            <WaveIndicator color="#ffcc00" />
                                        </View>)
                                    }

                                </ScrollView>
                            </View>
                        </Modal>
                </Container>

            );
        }
    }
}
